import React from "react";
import Jobster from "../assets/images/Jobster.png";
import Stargazers from "../assets/images/Stargazers.png";
import WorkDay from "../assets/images/WorkDay.png";

const styles = {
  card: {
    width: "18rem",
    padding: "10px",
    margin: "10px",
  },
  header: {
    width: "75%",
    margin: "0 auto",
    textAlign: "center",
    padding: "20px",
  },
  p: {
    width: "60%",
    margin: "0 auto",
    textAlign: "center",
    padding: "10px",
  },
  cols: {
    width: "75%",
    margin: "0 auto",
    justifyContent: "center",
  },
};

